import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHouseChimneyWindow,
  faAddressCard,
  faRectangleList,
} from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";
import { tabControl } from "../helper";

const MobileNavBar = ({setIsHome,
  setIsAbout,
  setIsProjects,
  setContent,
  content}) => {
  return (
    <nav className="mobile-nav not-fancy-font">
      <Link to="/about">
      <button className="bloc-icon flex flex-col border-none bg-transparent mt-1"   onClick={() =>
              tabControl(
                "about",
                setIsHome,
                setIsAbout,
                setIsProjects,
                setContent
              )
            }>
        <FontAwesomeIcon
          icon={faAddressCard}
          className="text-30 text-dark-gray"
        />

          About

      </button>
      </Link>

      <div className="bloc-icon flex flex-col">
        <FontAwesomeIcon
          icon={faHouseChimneyWindow}
          className="text-30 text-dark-gray"
        />
        <div>Home</div>
      </div>
      <div className="bloc-icon  flex flex-col">
        <FontAwesomeIcon
          icon={faRectangleList}
          className="text-30 text-dark-gray"
        />
        <div>Projects</div>
      </div>
    </nav>
  );
};

export default MobileNavBar;
